import React, { useState } from 'react';
import {
  StyledForm,
  FieldGroup,
  FieldLabel,
  FieldDescription,
  BaseInput,
  Select,
  TechnicalGrid,
  TabNavigation,
  Tab,
  FormLayout,
  FormSection,
  InputGroup,
  FormActions,
  SubmitButton,
  SectionTitle,
  TechnicalSection,
  NavButtons,
  NavButton
} from './styles';
import api from '../../services/api';

const ClienteForm = () => {
  const [formData, setFormData] = useState({
    consumoMensal: '',
    demandaContratada: '',
    tensaoFornecimento: '',
    classeConsumidor: '',
    modalidadeTarifaria: '',
    diasFuncionamento: '',
    horarioFuncionamento: { inicio: '', fim: '' }
  });

  const [error, setError] = useState('');
  const [fornecedores, setFornecedores] = useState([]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Validação de consumo > 0
    if (!formData.consumoMensal || Number(formData.consumoMensal) <= 0) {
      setError('consumoMensal', 'O consumo mensal deve ser maior que zero');
      return;
    }

    try {
      const response = await api.post('/buscar-fornecedores', formData);
      setFornecedores(response.data);
    } catch (error) {
      console.error('Erro:', error);
      setError('api', 'Erro ao buscar fornecedores');
    }
  };

  return (
    <StyledForm onSubmit={handleSubmit}>
      <NavButtons>
        <NavButton active>Buscar Fornecedores</NavButton>
        <NavButton>Análise de Economia</NavButton>
        <NavButton>Comparar Fornecedores</NavButton>
        <NavButton>Configurações</NavButton>
      </NavButtons>

      <FormLayout>
        {/* Coluna da esquerda - Dados de Consumo */}
        <FormSection>
          <SectionTitle>Dados de Consumo</SectionTitle>
          <FieldGroup>
            <FieldLabel>Consumo Mensal (kWh)</FieldLabel>
            <BaseInput
              type="number"
              name="consumoMensal"
              value={formData.consumoMensal}
              onChange={handleInputChange}
              placeholder="Ex: 30000"
            />
            <FieldDescription>Média dos últimos 12 meses</FieldDescription>
          </FieldGroup>

          <FieldGroup>
            <FieldLabel>Demanda Contratada (kW)</FieldLabel>
            <BaseInput
              type="number"
              name="demandaContratada"
              value={formData.demandaContratada}
              onChange={handleInputChange}
              placeholder="Ex: 100"
            />
            <FieldDescription>Potência contratada atual</FieldDescription>
          </FieldGroup>
        </FormSection>

        {/* Coluna da direita - Dados Técnicos */}
        <TechnicalSection>
          <SectionTitle>Dados Técnicos</SectionTitle>
          <TechnicalGrid>
            <FieldGroup>
              <FieldLabel>Tensão de Fornecimento</FieldLabel>
              <Select
                name="tensaoFornecimento"
                value={formData.tensaoFornecimento}
                onChange={handleInputChange}
              >
                <option value="baixa">Baixa Tensão (BT)</option>
              </Select>
            </FieldGroup>

            <FieldGroup>
              <FieldLabel>Classe do Consumidor</FieldLabel>
              <Select
                name="classeConsumidor"
                value={formData.classeConsumidor}
                onChange={handleInputChange}
              >
                <option value="comercial">Comercial</option>
              </Select>
            </FieldGroup>

            <FieldGroup>
              <FieldLabel>Modalidade Tarifária</FieldLabel>
              <Select
                name="modalidadeTarifaria"
                value={formData.modalidadeTarifaria}
                onChange={handleInputChange}
              >
                <option value="convencional">Convencional</option>
              </Select>
            </FieldGroup>
          </TechnicalGrid>
        </TechnicalSection>

        <FormActions>
          <SubmitButton type="submit">Buscar</SubmitButton>
        </FormActions>
      </FormLayout>
    </StyledForm>
  );
};

export default ClienteForm;
